var jumbo = require('react-bootstrap/lib/Jumbotron');

const Jumbotron = () => {
    return (
   	 <jumbo>
   		 <h1>Olá iMasters!</h1>
    	<p>Este é um exemplo do Componente Jumbotron construído com o React-Boostrap!</p>
    	<p><button bsStyle="primary">Aprenda mais!</button></p>

   	 </jumbo>
    )
}

export default Jumbotron;
